(33958, 66811, 0, 1, '禁忌語言', '', '2011-03-27 00:00:00', 2000, 20, 0, 7, '我，面對這世界，企圖去改變，改變確定的時間。 \r\n你，鏡子裡的雙眼，沒情緒的語言，被監控的行為。 \r\n\r\n打開了這種禁忌語言，種種的嘲弄打在身邊。 \r\n受到傷害一再重演，生命的左右，我無法去叛變。 \r\n只要給我一次機會，我不會再去承受無言。 \r\n最後的生命，在你的嘴邊，只要你願意走向前。 \r\n\r\n等，再走快一點，離痛遠一些，就不會有感覺。 \r\n但，總是事與願違，不能去違背，智者的預言。 ', '', 196, '', 'FAKEMONKEY', 'FAKEMONKEY', 'KYO', '', '', 0, 1, 0, '2011-03-27 21:44:50', '2015-03-12 13:46:26', '0000-00-00 00:00:00'),
