(33961, 107639, 0, 1, 'Everybody(2011 DEMO)', '', '2011-03-28 00:00:00', 2000, 0, 1, 7, 'Everybody 抬起頭 是不是有很多事想要做\nEverybody 舉起手 現實的牢籠無法囚禁自由\nEverybody Never mind 不要讓阻礙來打退你我\nCome on baby 相信我 有時候堅持自己 並沒有錯\n \noh  別再說自己沒有用\noh  不要再躲在你那小小的角落\noh  有時候對自己好一點 沒有錯\noh  每個人都是自己的英雄\n \n生活中充滿許多的不如意\n每件事情放在心底 哩早晚欸係\n不如放下一切沉痛努力來證明自己\n路上遭受的挫敗使我們變得更加剛毅\n我吐著層層煙圈試著不顯露疲憊\n懊悔的子彈時時刻刻都想把我擊潰\n經過一切的一切 緊握住我的是誰\nEveryone say never give up', '', 290, '', 'Ukase', 'Ukase', '', '', '', 0, 1, 1, '2011-03-28 01:18:56', '2014-02-09 21:53:10', '2014-02-09 21:53:10'),
(33962, 84478, 0, 1, '香腿妹', '做錯事不可恥,做錯事不認錯甚至不認為自己錯真的該死\r\n\r\n知恥近乎勇　香腿請三思', '2011-03-28 00:00:00', 2000, 0, 1, 6, '打開網路 看見 打開新聞也 看見 螢幕中的那張臉\r\n\r\n無助慌張的雙眼 冷眼旁觀的 那些\r\n\r\n教育失敗的照寫 血淋淋的在眼前\r\n\r\n不要以為我們看不見  這裡不是你能夠 隻手遮天\r\n\r\n\r\n請記住這張特寫 影片中的那  一雙腿\r\n\r\n如果你肯好好的道歉  可惜你卻不懂得 珍惜這個機會\r\n\r\n\r\n記得國中大家都是約好 定孤支的 但是妳們一群人弄一個人\r\n\r\n真的是有夠丟臉的 人家就說沒有了 怎麼不找另外一個人來對質咧\r\n\r\n好 就算他真的北爛欠打 你也不要白癡到把影片傳上來炫耀\r\n\r\n新聞都在報 我看你 怎麼跟你父母交代啦  \r\n\r\n\r\n\r\n畫面中 拉扯著誰的臉  故事中 有多少殘缺頁\r\n\r\n暴力中 無助的那滴淚  嬉鬧中 猙獰的惡魔孽\r\n\r\n\r\n\r\n你現在開始跳這 跳那  都沒效  你怎麼跳 都會被認出來\r\n\r\n我想你的腿已經紅過志玲姐姐 因為現在開始你是全民公敵\r\n    \r\n那些嗆聲話都被節錄下來 我真的替你感到悲哀\r\n\r\n不知道你們習慣注目禮了沒  妳們這群社會的敗類\r\n\r\n麵包店 不錄用  加油站 不錄用 可能連直銷 都不太想鳥你\r\n\r\n當乞丐大家還嫌你髒 如果不懂悔改 你的人生畫下句點\r\n\r\n\r\n畫面中 拉扯著誰的臉  故事中 有多少殘缺頁\r\n\r\n暴力中 無助的那滴淚  嬉鬧中 猙獰的惡魔孽\r\n\r\n\r\n\r\n我 還有很多話想說 我 還有很多事沒做\r\n\r\n我的能力還不夠   正義需要高強的武功\r\n\r\n\r\n但 我會有一天成功  用我的話語改變很多\r\n\r\n拿錢不做事的人 要小心 哪天換你跪著被霸菱\r\n\r\n\r\n如果換你兒子被打 如果換你女兒被打\r\n\r\n做人要有點同理心 不要每天只會數錢\r\n\r\n\r\n\r\n畫面中 拉扯著誰的臉  故事中 有多少殘缺頁\r\n\r\n暴力中 無助的那滴淚  嬉鬧中 猙獰的惡魔孽\r\n\r\n\r\n陰暗中 猙獰的那張臉  鏡頭前 作秀的那張嘴\r\n\r\n下課鐘 是和平的錯覺  老百姓 的安全被打劫\r\n\r\n\r\n', '', 188, '', '陳零九', '陳零九', '陳零九', '', '', 0, 1, 0, '2011-03-28 08:51:45', '2015-03-12 13:46:26', '0000-00-00 00:00:00'),
