(33994, 1484, 0, 1, '我們 (先聽版)', 'Tizzy Bac 2011全新創作歌曲「我們」先聽版，電影「烈火焚身」中文主題曲。 「我們」這首歌充滿了深沈與反省的人文精神，編曲層次堆疊表現出由自我而向外在對真理的渴望。', '2011-05-18 00:00:00', 2000, 25, 0, 7, '', '', 369, '', 'Tizzy Bac', '陳惠婷', '', '彎的音樂', '', 0, 0, 1, '2011-03-29 13:14:50', '2013-10-07 17:18:20', '0000-00-00 00:00:00'),
