(33998, 107780, 3285, 4, 'Autumn In New York', '', '2003-01-01 00:00:00', 2000, 25, 0, 15, '', 'Autumn in New York\nWhy does it seem so inviting?\nAutumn in New York\nIt spells the thrill of first-nighting\n\nGlittering crowds and shimmering clouds in canyons of steel\nThey''re making me feel　 I''m home\n\nIt''s autumn in New York\nThat brings the promise of new love\nAutumn in New York\nIs often mingled with pain\n\nDreamers with empty hands\nThey sigh for exotic lands\n\nIt''s autumn in New York\nIt''s good to live it again\n\n', 323, '', '', '', '', '', '', 0, 1, 0, '2011-03-29 23:43:16', '2015-03-12 13:46:27', '0000-00-00 00:00:00'),
(33999, 108000, 0, 1, 'Kumo - 兩小無猜 (Instrumental)', '歌曲背景介紹：\r\n\r\n為一套電影作的主題曲 電影叫作《Waiting For Forever》\r\n\r\n一個男主角一直由小時候等待一個兒時玩伴，長大了，還是等不到她，她還已經是人家的未婚妻了，不過他還是抱著希望去等待這個他認為是最好最美麗的愛情。', '2011-03-29 00:00:00', 2000, 20, 0, 4, '00:10 轉眼間又過一年 依然缺了你的笑 \r\n00:19 不說愛牽我手 卻又牽我的心遠走 \r\n00:28 回想當天那感覺 我想這算是愛情 \r\n00:36 白如雪純如水 樂會笑悲就會流淚 \r\n\r\n00:45 我不能停在回憶 回憶想太多就變得殘酷 \r\n00:53 想要未來就要抉擇 選定了我不退後 \r\n01:01 雖然能找回你 可惜你牽了別個他的手 \r\n\r\n01:09 是你忘了最初承諾 \r\n01:12.5 我不是搞破壞 我想回我倆的從前 多愉快 \r\n01:20 天真的都成熟了 重遇的溫柔會怎樣 \r\n01:28 疲憊的小木馬 載我們到從前好嗎 \r\n01:37 再也不會 \r\n01:41.5 分開', '', 109, '', '雲 (Kumo)', '花弄晚雨籠晴 ', '雲 (Kumo)', '', '', 0, 0, 1, '2011-03-29 23:52:47', '2013-10-07 17:18:20', '0000-00-00 00:00:00'),
