(34011, 63835, 0, 1, '想聽什麼帥哥？(demo)', '', '2011-03-30 00:00:00', 2000, 0, 2, 2, 'Ray Ray DJ  veeky veeky 就像我是missy\r\nhe say she say 跟著音樂點頭不用拍謝\r\n今天 重點 我想帶你進入一場冒險\r\n你想進入這場冒險？wonderland可能還差一點\r\n快聽一聽 Ray Ray babe\r\n這節奏讓你crazy\r\n不管是什麼風格 我有我自己特色\r\n我非常二十一世紀 你知道我在說的？\r\n好 這音樂還是不夠大聲\r\nddddj音樂還要大聲\r\n不然耳機給我 小心不要跳針\r\n那 說了還是一樣跳針\r\n\r\n我像個卡拉ok 我是你愛的dj\r\n我每天幫你放歌 你想聽什麼帥哥\r\n\r\n我像個卡拉ok 我是你愛的dj\r\n我每天幫你放歌 你想聽什麼帥哥\r\n\r\n你想聽什麼帥哥\r\n你想聽什麼帥哥\r\n你想聽什麼帥哥\r\n你想聽什麼帥哥\r\n', '', 223, '', 'Terrytyelee', 'Terrytyelee,RayRay', 'Terrytyelee', '', '', 1, 1, 0, '2011-03-30 00:35:37', '2015-03-12 13:46:28', '0000-00-00 00:00:00'),
