(34014, 106267, 0, 1, 'Rain and Tears', 'Rain and Tears 是由希臘一個樂團 Aaphrodite''s child (翻成中文應該是 愛神之子) 於1968年成軍後出品的曲子\r\n這裡提供出來我唱的來介紹給大家\r\n\r\n', '2011-03-30 00:00:00', 2000, 0, 2, 4, 'Rain and tears are the same\r\nbut in the sun you got to play the game\r\nwhen you cry in wintertime\r\nyou can''t pretend it''s nothing but the rain\r\n\r\nHow many times I''ve seen\r\ntears coming from your blue eyes\r\n\r\nRain and tears are the same\r\nbut in the sun you got to play the game\r\n\r\nGive me an answer, love \r\nI need an answer, love\r\nrain and tears in the sun\r\nbut in your heart you feel the rain, the waves\r\n\r\nRain or tears both rush home\r\nfor in my heart there never be the sun\r\nrain and tears are the same\r\nbut in the sun you got to play the game', '', 213, '', 'Aphrodite''s child', '', '', '', '', 0, 1, 0, '2011-03-30 07:04:46', '2015-03-12 13:46:28', '0000-00-00 00:00:00'),
