(34022, 87864, 3153, 1, '循環 Recycle', '循環歌曲\r\n以輕鬆旋律及歌詞\r\n帶大家一齊關注都市環保問題\r\n重新感受大自然的呼應\r\n同時希望將歌中的正能量注入聽眾心中像歌詞中 "循環不休不息 不放棄" ', '2011-04-01 00:00:00', 2000, 0, 2, 4, '廢吧 棄置在廢墟火化 \r\n靜待輪迴也罷\r\n\r\n不可取嘛 我縱是廢不可怕\r\n帶冀望再可萌芽\r\n\r\n無用處我也好奇 \r\n誰沒有將我遺棄\r\n死心不息創出趣味 woo~\r\n\r\n滿以為 世間早已忘記 \r\n是再飛的生氣 woo~\r\n\r\n天都不枉廢 滿臉希冀\r\n讓我再發亮 重亮起需空氣\r\n多得你 我殘而未廢\r\n讓我有力氣 循環不休不息 不放棄\r\n\r\n去吧 去變做一堆黑炭\r\n繼續燃亮我吧\r\n\r\n不需醜化 我永沒假裝優雅\r\n這廢柴枯朽不化\r\n\r\n無用處我也好奇 \r\n誰沒有將我遺棄\r\n死心不息創出趣味 woo~\r\n\r\n滿以為 世間早已忘記 \r\n是再飛的生氣 woo~\r\n\r\n天都不枉廢 滿臉希冀\r\n讓我再發亮 重亮起需空氣\r\n多得你 我殘而未廢\r\n讓我有力氣 循環不休不息 不放棄', '', 241, '', 'Chi ChinG@The3Think', '王兆東', 'AddY@The3Think / Kenneth@The3Think', '', '', 0, 1, 0, '2011-03-30 15:46:22', '2015-03-12 13:46:28', '0000-00-00 00:00:00'),
