(34044, 92272, 0, 1, 'Break Out-Demo', '想要說的話，想要說的事，想要實現的夢。\r\n就算遇到挫折，遇到困難，還是要堅持下去!!!!', '2011-03-30 00:00:00', 2000, 0, 1, 7, '不停的犯錯 為自己修補\r\n睜開眼睛看天空的時候 又悔不當初\r\n不停的責怪 還怨天尤人\r\n脫下面具轉身離開的時候 又感覺無奈\r\n\r\n我掉入自己設下的陷阱 身旁不停的逝去\r\n我縮在自己美好的夢裡 卻走不下去\r\n\r\nBreak out Break out \r\nBreak out Break out 我想要逃離\r\nBreak out Break out \r\nBreak out Break out 我不想失去\r\n\r\n想要說的話 想要做的事 想要實現的夢\r\n能不能', '', 202, '', 'The Third Party', 'SIN', '', '獨立', '', 0, 1, 0, '2011-03-30 19:19:00', '2015-03-12 13:46:29', '0000-00-00 00:00:00'),
(34045, 92272, 0, 1, '兩個世界-Demo', '我們在各自的道路上追求夢想，雖然互相遇不到，但相信有一天能在同一個世界相遇。', '2011-03-30 00:00:00', 2000, 0, 2, 7, '地平線 的盡頭 找不到自我\r\n轉身後 才發現 遙遠的天空\r\n\r\n只能默默低著頭 默默讓視線溜走\r\n\r\n空白的 虛假的 幻滅的 破裂的\r\n在兩個不同世界遊走 卻又\r\n不停的 抓住我 緊握著 不放手\r\n不讓我逃離這個世界\r\n\r\n', '', 212, '', 'The Third Party', 'SIN', '', '獨立', '', 0, 0, 0, '2011-03-30 19:21:55', '2015-03-12 13:46:29', '0000-00-00 00:00:00'),
