(34054, 107780, 3289, 5, 'Nice Work If You Can Get It', '', '2005-01-01 00:00:00', 2000, 25, 0, 15, '', 'The man who only live for making money\nLives a life that isn''t necessarily sunny;\nLikewise the man who works for fame --\nThere''s no guarantee that time won''t erase his name\nThe fact is\nThe only work that really brings enjoyment\nIs the kind that is for girl and boy meant.\nFall in love -- you won''t regret it.\nThat''s the best work of all -- if you can get it.\nHolding hands at midnight\n''Neath a starry sky...\n\nOh that is nice work if you can get it.\nAnd you can get it -- if you try.\nStrolling with the one girl\nSighing sigh after sigh...\nOh nice work if you can get it.\nAnd you can get it -- if you try.\n\nJust imagine someone\nWaiting at the cottage door.\nWhere two hearts become one...\nWho could ask for anything more?\n\nLoving one who loves you,\nAnd then taking that vow...\nNice work if you can get it,\nAnd if you get it --\n\nWon''t you tell me how?\n\nAnd you can get it -- if you try.\nAnd you can get it -- if you try.\nAnd you can get it -- if you try.\nAnd you can get it -- if you try\n\nHolding hands at midnight\n''Neath a starry sky...\nNice work if you can get it\nAnd you can get it -- if you try.\nStrolling with the one girl\nSighing sigh after sigh...\nNice work if you can get it\nAnd you can get it -- if you try\nWho could ask for anything more? \n', 247, '', '', '', '', '', '', 0, 1, 0, '2011-03-30 20:14:23', '2015-03-12 13:46:29', '0000-00-00 00:00:00'),
