(34059, 4244, 3281, 2, '02 ｆｌｙｉｎｇ　ｔｈｒｏｕｇｈ　ｔｈｅ　ｃｏｓｍｏｓ', '', '2011-04-08 00:00:00', 2011, 20, 0, 7, '< Flying through the cosmos >\r\n\r\nFly~ \r\nOh fly~ oh fly~\r\nLet''s get some high.\r\nOh fly~ oh fly~\r\nAcross the sky.\r\nOh fly~ oh fly~\r\nJust close your eyes.\r\nOh fly~ oh fly~\r\nTill out of sight.', '', 241, '', '松本，夢蘿', '夢蘿', '小宇宙樂團', '', '', 1, 1, 0, '2011-03-30 22:29:42', '2015-03-12 13:46:30', '0000-00-00 00:00:00'),
(34060, 4244, 3281, 4, '04 ＳＫＹＲＯＣＫＥＴ', '', '2011-04-08 00:00:00', 2011, 20, 0, 7, '< SKYROCKET >\r\n\r\n睜大眼睛 請睜大你的眼睛\r\n用視覺記憶來見證這個奇蹟\r\n將這段美麗的情景狠狠烙印\r\n別在錯過之後才覺得可惜\r\n啊  曇花就要盛開  就像我們的戀情\r\n\r\n不要懷疑 不要懷疑你的眼睛\r\n幸福就快要劃過我們的頭頂\r\n趕快許下願望沒有時間猶豫\r\n請說出那句關鍵性的咒語\r\n看  流星就要墜落  就像我們的戀情\r\n短暫的  讓人分不清楚是現實還是夢境\r\n\r\n曇花一現的交集  曇花一現的美麗\r\n穿越億萬光年的距離  只為剎那的相聚\r\n曇花一現的回憶  曇花一現的甜蜜\r\n我想要留下一些證據  卻只能睜大眼睛\r\n\r\n唉  煙火就要殆盡  就像我們的戀情\r\n別忘記  那些我們曾經一起感動的風景\r\n\r\n曇花一現的交集  曇花一現的美麗\r\n當最後一朵花火凋零  天空恢復了平靜\r\n曇花一現的回憶  曇花一現的甜蜜\r\n我用盡全力睜大眼睛  所有的不可思議\r\n卻化為泡影  就像我們的戀情\r\n', '', 235, '', '', '', '', '', '', 1, 1, 0, '2011-03-30 22:31:01', '2015-03-12 13:46:30', '0000-00-00 00:00:00'),
(34061, 4244, 3281, 5, '05 ｙｏｕｒ　ｖｏｉｃｅ', '', '2011-04-08 00:00:00', 2011, 20, 0, 7, '< Your Voice >\r\n\r\npenetrate my ears , penetrate my eyes.\r\npenetrate my heart and my mind.\r\nbring me to the sky\r\nthrough the night.\r\n\r\npenetrate my dream , penetrate my time.\r\npenetrate my soul and my life.\r\nmake me feel right\r\nuntil I die.\r\n\r\nwhen you are singing it''s a knife\r\nthrusting into my heart I can''t hide.\r\nwhen you are humming it''s a lullaby\r\nmake me feel like a child.\r\n\r\nby my side\r\nlet me fly \r\nuntil I die.\r\n', '', 225, '', '夢蘿', '夢蘿', '小宇宙樂團', '', '', 1, 1, 0, '2011-03-30 22:31:55', '2015-03-12 13:46:30', '0000-00-00 00:00:00'),
(34062, 4244, 3281, 6, '06 夜光星星', '', '2011-04-08 00:00:00', 2011, 20, 0, 7, '< 夜光星星 >\r\n\r\n你習慣我的憂鬱  習慣我的沉默  \r\n也習慣我的心事重重\r\n我依賴你的溫柔  依賴你的笑容  \r\n更依賴你給我的夢\r\n\r\n我就像是沒有生存能力的夜光星星\r\n需要藉助別人的光和熱\r\n才能證明自己存在的意義\r\n\r\n夜光星星  沒有自己發光的力氣\r\n夜光星星  只能依靠我所愛的你\r\n夜光星星  微弱的光  是你賜與\r\n夜光星星  當愛散去也消失在夜裡\r\n\r\n我就像是沒有生存能力的夜光星星\r\n需要藉助別人的光和熱\r\n才能證明自己存在的意義\r\n\r\n夜光星星  沒有自己發光的力氣\r\n夜光星星  只能依靠我所愛的你\r\n夜光星星  微弱的光  是你賜與\r\n夜光星星  當愛散去也消失在夜裡\r\n', '', 205, '', '', '', '', '', '', 1, 1, 0, '2011-03-30 22:33:01', '2015-03-12 13:46:30', '0000-00-00 00:00:00'),
(34063, 4244, 0, 6, '狂潮', '', '2011-04-08 00:00:00', 2011, 20, 0, 7, '<狂潮>\r\n\r\n飄揚的長頭髮 和巨大的浪花\r\n墜落的紅太陽 與傳說的童話\r\n上升的海平面 和腳底的流沙\r\n散落的滿天星 與遠方的燈塔 \r\n\r\n咆哮的海浪席捲而來彷彿要將我吞下\r\n發狂的想念排山倒海就快要把我溶化\r\n再堅硬的岩石 也不敵狂浪的拍打\r\n\r\n我的心啊 依然深陷在那個有你的夏 無法自拔\r\n但是你啊 可曾知道有個女孩為了你 苦苦牽掛\r\n讓風吹吧 吹到世界盡頭和天涯\r\n         　　吹到思念開成了花\r\n至少我們還站在同一個星空之下 \r\n\r\n飛舞的長頭髮 和白色的浪花\r\n燃燒的紅太陽 與殘酷的童話\r\n下降的海平面 和沾濕的流沙\r\n消失的滿天星 與熄滅的燈塔 \r\n\r\n我的夢啊 凍結在你離我而去的剎那 快要爆炸\r\n想著你啊 這份想念綿延到地老天荒 無垠無涯\r\n讓我唱吧 唱到末日聲音變沙啞 \r\n         　　唱到眼淚變成浪花\r\n至少我們還活在同一個天空底下 我不再掙扎', '', 237, '', '夢蘿', '夢蘿', '小宇宙樂團', '', '', 1, 1, 0, '2011-03-30 22:33:45', '2015-03-12 13:46:30', '0000-00-00 00:00:00'),
(34064, 4244, 0, 6, '狂潮', '', '2011-04-08 00:00:00', 2011, 20, 0, 7, '', '', 237, '', '', '', '', '', '', 0, 0, 1, '2011-03-30 22:34:28', '2013-10-07 17:18:20', '0000-00-00 00:00:00'),
(34065, 4244, 3281, 10, '10 夜貓探戈', '', '2011-04-08 00:00:00', 2011, 20, 0, 7, '< 夜貓探戈 >\r\n\r\n三更半夜  漫步在無人街道\r\n萬籟俱寂  只有我手舞足蹈\r\n花花世界  夜晚比白天美妙\r\n我的地盤  誰都不>能>夠>來>打擾\r\n\r\n夜深人靜  城市的霓虹閃耀\r\n生命短暫  快樂要自己創造\r\n搖擺身體  炫耀著我的皮毛\r\n我的美麗  越晚就>越>值>得>驕傲\r\n\r\n喵喵喵~~睡不著  喵喵喵~~好無聊\r\n喵喵喵~~一起來  喵喵喵~~湊熱鬧\r\n心浮氣躁  想要尖叫  丟掉煩惱  一起來跳\r\n\r\n夜貓探戈  晝伏夜出是我的調調\r\n夜貓探戈  餓了就用眼神來乞討\r\n貓咪的世界  你們人類到底了不了\r\n\r\n黎明破曉  街頭也開始喧鬧\r\n無聲無息  出現了一隻野貓\r\n冷眼旁觀  紛紛擾擾的人潮\r\n牠的眼神  透露著>一>絲>絲>高傲\r\n\r\n夕陽西下  所有的人都累了\r\n加快腳步  飛奔回家的懷抱\r\n黃色月亮  靜靜的掛在樹梢\r\n星星亮了  夜晚的>貓>咪>在>微笑\r\n\r\n喵喵喵~~睡不著  喵喵喵~~好無聊\r\n喵喵喵~~一起來  喵喵喵~~湊熱鬧\r\n心浮氣躁  想要尖叫  丟掉煩惱  一起來跳\r\n\r\n夜貓探戈  晝伏夜出是我的調調\r\n夜貓探戈  餓了就用眼神來乞討\r\n貓咪的世界  你們人類到底了不了', '', 233, '', '松本', '夢蘿', '小宇宙樂團', '', '', 1, 1, 0, '2011-03-30 22:35:52', '2015-03-12 13:46:30', '0000-00-00 00:00:00'),
