(34069, 63835, 0, 1, '太空情歌(demo)', '', '2011-03-31 00:00:00', 2000, 0, 2, 12, '今晚去看星星 我們今晚看星星\r\n今晚去看星星 我們今晚看星星\r\n今晚去看星星 我們今晚看星星\r\n今晚去看星星 我們今晚看星星\r\n\r\n這是一首太空情歌\r\n宇宙繞你轉著\r\n太空船載 令我窒息的愛\r\n愛 愛 愛 愛 愛\r\n我帶你去\r\n愛 愛 愛 愛 愛\r\n\r\nwee~ 我把你送走 你不要回頭\r\n你不用擔心你可可以可以放手\r\n倒數在進行 五四三二一\r\n一直在做夢而已\r\n音樂節奏跟著宇宙律動\r\n我跟著你在太空做夢\r\ndream dream dream\r\nyou and me 我和你\r\n\r\n這是一首太空情歌\r\n宇宙繞你轉著\r\n太空船載 令我窒息的愛\r\n愛 愛 愛 愛 愛\r\n我帶你去\r\n愛 愛 愛 愛 愛', '', 96, '', 'Terrytyelee', 'Terrytyelee,RayRay', 'Terrytyelee', '', '', 1, 1, 0, '2011-03-31 06:33:04', '2015-03-12 13:46:30', '0000-00-00 00:00:00'),
(34070, 108149, 3292, 1, '玫瑰當初', '', '2011-03-31 00:00:00', 2000, 20, 0, 4, '野玫瑰送給您的時\r\n正是春天的蝴蝶期\r\n迷人的粉紅花裙\r\n親像浪浪漫漫的玫瑰花蕊\r\n夜快車離開你的時\r\n正是秋天月當圓\r\n懷念的Kiss滋味\r\n親像甘甘蜜蜜的櫻桃香味\r\n海風輕輕鬆鬆\r\n路燈簡簡單單\r\n港都孤孤單單\r\n乎我  想起當初', '', 244, '', '黃恢弘', '黃恢弘', '', '', '', 0, 1, 0, '2011-03-31 09:24:31', '2015-03-12 13:46:30', '0000-00-00 00:00:00'),
(34071, 108149, 3292, 2, '台灣禮讚', '', '2011-03-31 00:00:00', 2000, 20, 0, 4, '玉山雄偉上穹蒼  矗立壯闊太平洋\r\n四季皆如春  百花齊芬芳\r\n咱的祖先在這開疆!\r\n嘉南地廣稻米倉  屏東土肥香蕉香\r\n甜蕃薯  土生長  飼豬.餵狗.日勤忙\r\n士農工商打拼有希望\r\n不驚山崩地裂  那怕列日寒霜\r\n愈挫愈勇  愈堅強\r\n台灣 台灣  永遠永遠是咱的故鄉\r\n                                        ', '', 275, '', '黃恢弘', '黃恢弘', '', '', '', 0, 1, 0, '2011-03-31 09:25:11', '2015-03-12 13:46:30', '0000-00-00 00:00:00'),
(34072, 108149, 3292, 3, '野莉安娜', '', '2011-03-31 00:00:00', 2000, 20, 0, 4, '野莉  野莉安娜\r\n野莉  野莉安娜\r\n軟香香的聲音\r\n幼咪咪的皮膚\r\n輕聲細說  嬌嬌滴滴\r\n乎人未講先醉\r\n熱情的巴蘭幾亞\r\n可愛的野莉安娜\r\n花紅柳綠  香豔刺激\r\n乎我免講嘛醉\r\n我所愛的不是伊迷人Slender的體格\r\n也不是伊妖嬌Charming的豔麗\r\n只是伊  只是伊  彼例講未出來的使妮             ', '', 291, '', '黃恢弘', '黃恢弘', '', '', '', 0, 1, 0, '2011-03-31 09:25:48', '2015-03-12 13:46:30', '0000-00-00 00:00:00'),
(34073, 108150, 3293, 1, '搖了!搖了!搖了!', '', '2011-03-31 00:00:00', 2000, 20, 0, 4, '滿腹的熱情，狂野的個性\r\n非凡的魄力，狂而不亂的時代\r\n滿場的人客，正港的體格\r\n相擠的爽快，鬧場的喊聲\r\n搖了！搖了！搖了！搖了！搖了！搖了！\r\n緊趁今宵一瞑，Beer酒通海，小菜免錢\r\n姑娘大方，少年大扮，大家做伙\r\n難得有緣，越看越深緣\r\n搖了！搖了！搖了！搖了！搖了！搖了！\r\n\r\n', '', 380, '', '黃明芳', '黃明芳', '', '', '', 0, 1, 0, '2011-03-31 09:45:11', '2015-03-12 13:46:30', '0000-00-00 00:00:00'),
